    return <Form>
        <Row>
            <Col lg={{span: 2, offset: 5}}>
                <Form.Group class="loginField">
                    <Form.Control placeholder="電郵"></Form.Control>
                </Form.Group>
            </Col>
        </Row>
        <Row>
            <Col lg={{span: 2, offset: 5}}>
                <Form.Group class="loginField">
                    <Form.Control placeholder="密碼"></Form.Control>
                </Form.Group>
            </Col>

        </Row>


    </Form>;

}

export default Login;
